import { useNavigate } from "react-router-dom";
import logo from "../images/bc-logo-white.png"
import "../styles/Footer.css";

export default function Footer() {
  const navigate = useNavigate();

  return(
    <div>
      <div className="footer">
        <div className="col-1" >
          <img src={logo}/>
        </div>
        <div className="col-2">
          <p className="footer-title">Braving Counseling with Vicki, LLC</p>
          <p className="handlee-regular"><i class="fa-regular fa-envelope" /> vicki@fakeemail.com</p>
          <p className="handlee-regular"><i class="fa-solid fa-mobile-screen" /> (352) 290-2038</p>
        </div>
        <div className="col-3"></div>
      </div>
    </div>
  )
}
